summary:
{The colors had disappeared two years ago; out of nowhere, the world had just turned grey, black, and white. At first, Kyoko had thought it was just a problem with her own eyes, which would already have been bad enough.

But then, Ayaka had opened her eyes and started crying in shock, mumbling something about the colors being gone.}
 Heavily inspired by the Soredemo Aruiteru MV.

